INSERT INTO `v1_20e5d766f6f46d68cc799dcbf7ae4a32a1fd26fafb3eb2763cb8410b99eedb78` VALUES ("1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！", "スタンダードコレクション", 3, "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！", 1, 1);
INSERT INTO `v1_20e5d766f6f46d68cc799dcbf7ae4a32a1fd26fafb3eb2763cb8410b99eedb78` VALUES ("1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", "プレミアムコレクション", 10, "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", 2, 1);
INSERT INTO `v1_20e5d766f6f46d68cc799dcbf7ae4a32a1fd26fafb3eb2763cb8410b99eedb78` VALUES ("1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！", "フェスコレクション", 3, "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！", 3, 1);
